import styled from 'styled-components';

export const Whrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 30px 10%;
`;

export const NavMenu = styled.nav`
  display: flex;
  background: #d82f4b;
  color: #fff;
  padding: 1em;
  border-radius: 25px;

  ul {
    list-style: none;
    padding: 0;
    margin: 0;
    display: flex;
    flex: 3;
  }

  li {
    font-weight: 500;
    font-size: 16px;
    color: #edf0f1;
    text-decoration: none;

    a {
      padding: 10px;
      text-decoration: none;
      color: #fff;
    }
  }
`;
